import './App.css';

import Practice from './components/Practice';
import NavBar from './components/NavBar';

import Polution from './components/Polution';
import ReviewForm from './components/ReviewForm';

function App() {

  return (
    <div className="container">
      <NavBar />
      <Practice />
      <ReviewForm />
      <Polution />
    </div>
  );
}

export default App;
